// src/App.js
import { BrowserRouter as Router, Route, Switch, Redirect } from 'react-router-dom';
import Auth from './Auth';
import Data from './Data';

function App() {
  const isAuthenticated = false; 

  return (
    <Router>
      <Switch>
        <Route path="/" exact>
          {isAuthenticated ? <Redirect to="/data" /> : <Data />}
        </Route>
        <Route path="/data">
          {isAuthenticated ? <Data /> : <Redirect to="/" />}
        </Route>
        <Route path="/login" component={Auth} />
      </Switch>
    </Router>
  );
}

export default App;
